import React from 'react';
import ReactDOM from 'react-dom/client';
import './App.css';

import { BrowserRouter as Router, Route } from 'react-router-dom'

const Home = () => <h1>Home</h1>

const nav = () =>(
  <Router>
    <Route path="/" component={Home} />
  </Router>
)

export default nav;
